    id: number;
    userName: string;
    userLastName: string;
    age: number;
    
  
}

const UserItem: React.FC<UserItemProps> = ({ id, userName, userLastName, age, position, onDragStop }) => {
    return (
       
            <div className="flex items-center justify-between py-7 px-10 text-xl bg-gray-100 border rounded-lg mb-4">
                <div>{id}</div> 
                <div>{userLastName} {userName}</div>
                <div>{age} years</div>
            </div>
     
    );
};

export default UserItem;
